import Draggable, { DraggableCore } from "react-draggable";

import "../home/styles.scss";

//componenets
import Window from "../../components/window";
import Icons from "../../components/icons"

const Home = () => {
  return (
    <div className="entire-display">
      <Draggable>
        <div>
          <Window />
        </div>
      </Draggable>
      <Draggable>
        <div>
          <Icons />
        </div>
      </Draggable>
    </div>
  );
};

export default Home;
